	render() {
		return (
			<Fragment>
				<section className='row filter'>
					<Col sm={1}>
						<Button name='Open Now' />
					</Col>
					<Col sm={1}>
						<Button name='Cuisine' />
					</Col>
					<Col sm={1}>
						<button className='btn' type='button'>
							Ratings <span>></span>
						</button>
					</Col>
					<div className=''></div>
				</section>
			</Fragment>
		);
	}
}

export default FilterBar;
